import React from 'react'
import * as FaIcons from "react-icons/fa";
import { Link } from 'react-router-dom';

function Menu() {
    return (
        <>
        <div className="menu">
            <link to="/" className='menu__bars'>
                <FaIcons.FaBars/>
            </link>
        </div>
        </>
    )
}

export default Menu;
